import React from "react";
import { Link } from "react-router-dom";

const navStyle = {
  display: "flex",
  gap: "12px",
  marginBottom: "16px",
  paddingBottom: "8px",
  borderBottom: "1px solid #ddd",
};

const Navbar = () => (
  <nav style={navStyle}>
    <Link to="/">Home</Link>
    <Link to="/reflected">Reflected XSS</Link>
    <Link to="/dom">DOM XSS</Link>
    <Link to="/stored">Stored XSS</Link>
    <Link to="/admin">Blind XSS (Admin)</Link>
  </nav>
);

export default Navbar;
